    function get_plot(is_use){
        if (is_use) {
            return use_plot
        } else {
            return graph_plot
        }
    }

    function get_data(is_use){
        if (is_use) {
            return use_data
        } else {
            return graph_data
        }
    }

    function get_point_info(data){
        return {
                xaxis : data.points[0].xaxis.range,
                yaxis : data.points[0].yaxis.range,
                pn : data.points[0].pointNumber,
                tn : data.points[0].curveNumber,
            }
    }

    function get_new_axis_range(axis, p){
        var range = (axis[1] - axis[0]) * 0.5
        return [p-range, p+range]
    }

    function get_xy_text(tn, pn, embed_data){
        var x = embed_data[tn]["x"][pn],
            y = embed_data[tn]["y"][pn],
            text = embed_data[tn]["text"][pn]

        return {x:x, y:y, text:text}
    }

    function update_layout(x, y, xaxis, yaxis){
        return {
            'xaxis.range': get_new_axis_range(xaxis, x),   
            'yaxis.range': get_new_axis_range(yaxis, y)
        }
    }

    function update_highlight(data){
        return {
            x : [[data.x]],
            y : [[data.y]],
            "marker": {"color": "red", "line": {"width": 0}, "size": 10},
            "hoverinfo" : "text",
            "text" : [data.text]
        }
    }

    function update_plot(point_info, is_use){
        var data = get_xy_text(point_info.tn, point_info.pn, get_data(is_use))
        var highlight_update = update_highlight(data)
        var layout = {}
        Plotly.update(get_plot(is_use), highlight_update, layout, [2]);
    }

function get_point_info(data){
    return {
            xaxis : data.points[0].xaxis.range,
            yaxis : data.points[0].yaxis.range,
            pn : data.points[0].pointNumber,
            tn : data.points[0].curveNumber,
        }
}

function get_new_axis_range(axis, p){
    var range = (axis[1] - axis[0]) * 0.5
    return [p-range, p+range]
}

function get_xy_text(tn, pn, embed_data){
    var x = embed_data[tn]["x"][pn],
        y = embed_data[tn]["y"][pn],
        text = embed_data[tn]["text"][pn]

    return {x:x, y:y, text:text}
}

function update_layout(x, y, xaxis, yaxis){
    return {
        'xaxis.range': get_new_axis_range(xaxis, x),   
        'yaxis.range': get_new_axis_range(yaxis, y)
    }
}

function update_highlight(data){
    return {
        // x : [[data.x]],
        // y : [[data.y]],
        x : [data.x],
        y : [data.y],
        "marker": {"color": "red", "line": {"width": 0, "color" : "red"}, "size": 10},
        "hoverinfo" : "text",
        "text" : [data.text]
    }
}

function update_plot(point_info, is_use){
    var data = get_xy_text(point_info.tn, point_info.pn, get_data(is_use))
    var highlight_update = update_highlight(data)
    Plotly.animate(get_plot(is_use), {
        data : [highlight_update],
        traces : [2],
        layout : {}
    }, {
        transition : {
            duration : 500,
            easing: 'cubic-in-out'
        },
        frame: {
            duration: 500
        }
    })

    // Plotly.update(get_plot(is_use), highlight_update, {}, [2]).then(plot => {

}
